import './vendors/bootstrap/bootstrap.min.css';

import {BrowserRouter, Route} from "react-router-dom";
import HelloWorld from "./components/a6/HelloWorld.js";
import Practice from "./components/a6/Practice";
import Build from "./components/a6/Build";
import ExploreScreen from "./components/a6/Build/ExploreScreen/ExploreScreen";
import NavigationSidebar from "./components/a6/Build/NavigationSidebar";
import WhoToFollowList from "./components/a6/Build/WhoToFollowList";
import HomeScreen from "./components/a6/Build/HomeScreen/HomeScreen";

function App() {
    return (
        <BrowserRouter>
            <div className="container">
                <Route path="/a6/hello" exact={true}>
                    <HelloWorld/>
                </Route>
                <Route path={["/", "/a6", "/a6/practice"]} exact={true}>
                    <Practice/>
                </Route>
                <Route path="/a6/home" exact={true}>
                    <ExploreScreen/>

                </Route>
                <Route path="/a6/explore" exact={true}>
                    <HomeScreen/>
                </Route>
            </div>
        </BrowserRouter>

    );
}
export default App;
